import Home from "./Home";
import RouterContent from "./RouterContent";
import VocabularyPage from "./VocabularyPage";

function Content({CourseList, removeCourse, addCourse}) {
    return (
        <main id="main" className="main">
            <RouterContent CourseList = {CourseList} removeCourse = {removeCourse} addCourse = {addCourse} vocabularyList = {vocabularyList} setVocabulary = {setVocabulary} />
        </main>
    );
}

export default Content;
